css:
/*
* This is sortof prepared for adjustable themes.
* Everything is based of a single color taken from the syntax theme.
*/
.project-manager input {
  width: 100%;
}
.project-manager-list-group {
  color: rgba(74, 76, 79, 0.82);
  text-shadow: none;
  padding: 1px 2px;
  margin-left: 10px;
  background: #2e3239;
  border-radius: 1px;
}
.selected .project-manager-list-group {
  color: #4a4c4f;
}
.project-manager-devmode {
  float: right;
}
.project-manager-devmode:before {
  content: "\f065";
  color: #d73a1e;
  font-family: 'Octicons Regular';
  font-weight: normal;
  font-style: normal;
  text-shadow: none;
  font-size: 14px;
  line-height: 1;
  display: inline-block;
}
